$(document).ready(function(){if($(window).width()<976){$('#navbarNavDropdown').on('show.bs.collapse',function(event){$('#navbarNavDropdown').find('.nav').css('padding-top','30px')})}
    if($(window).width()>976){$('#navbarNavDropdown').on('show.bs.collapse',function(event){$('#navbarNavDropdown').find('.nav').css('padding-top','0px')})}
    $(".circle").click(function(event){var img,target;target=$("#equipe-celular");if(target.val()<6&&$(this).css("z-index")==99){target.val(Number(parseInt(target.val())+1));if(target.val()==1){target.val(2)}
        img='img'+target.val();$(".estrategia img").css("z-index","-1");$(".estrategia").find('img[data-target='+img+']').css('z-index',1)}
        if(target.val()>=1&&$(this).css("z-index")==88){target.val(Number(parseInt(target.val())-1));if(target.val()>=1){img='img'+target.val();$(".estrategia img").css("z-index","-1");$(".estrategia").find('img[data-target='+img+']').css('z-index',1)}}
        return!1});var $doc=$('html, body');$('a').click(function(){$doc.animate({scrollTop:$($.attr(this,'href')).offset().top},800);return!1});$('.portfolios-conteudo img').click(function(event){var target=$(event.target);var modal=$('#modal');var modalImg=$("#modal-image");var captionText=$('#caption');modal.css('display','block');modalImg.attr('src',target.attr('data-target'));captionText.text(target.attr('alt'))})});$(window).on('load',function(){$("#equipe-celular").val(0)});$(window).resize(function(){if($(window).width()<976){$('#navbarNavDropdown').on('show.bs.collapse',function(event){$('#navbarNavDropdown').find('.nav').css('padding-top','30px')})}
    if($(window).width()>976){$('#navbarNavDropdown').on('show.bs.collapse',function(event){$('#navbarNavDropdown').find('.nav').css('padding-top','0px')})}})